import React, { Component } from 'react';
import {  Text, View,StyleSheet, TextInput, Button} from 'react-native';
import { StatusBar } from 'expo-status-bar';
import DatePicker from '../task2/datePicker';
//import Dropdown from '../task2/dropDown';





class App extends Component{
    constructor(){
        super()
        this.state ={
            firstName:'',
            lastName:'',
            email:'',
            phoneNumber:'',
            title:'',


        }
    }
    handleFirstname = (text) =>{
        this.setState ({firstName:text})
    }
    handleLastname = (text) =>{
        this.setState ({lastName:text})
    }
    submit(){
        console.warn (this.state)
        
    }
        
    render(){
        return(
            <View style = {styles.regform}>
                <View>
                   <Text style={styles.header}>
                       Registration Form</Text> 
                </View>

                <Text><b>FirstName</b></Text> 
                    <TextInput style = {styles.input}
                        placeholder = 'FirstName' onChangeText = {this.handleFirstname}>
                    </TextInput>
                <Text><b>LastName</b></Text>
                    <TextInput style = {styles.input}
                        placeholder = 'LastName' onChangeText = {this.handleLastname}>
                    </TextInput>
                <Text><b>Email</b></Text>
                    <TextInput style = {styles.input}
                        placeholder = 'email' onChangeText = {(text) => {this.setState({email:text})}}>
                </TextInput>
                <Text><b>PhoneNumber</b></Text>
                    <TextInput style = {styles.input}
                        placeholder = 'PhoneNumber' onChangeText = {(text) => {this.setState({phoneNumber:text})}}>
                </TextInput>

            
                <View style = {styles.date} >
                    <Text style = {styles.dob}>
                        <b>Date Of Birth : </b>
                    </Text>
                    <Text>
                        <DatePicker/>
                    </Text>
                </View>

                <Text><b>Title</b></Text>
                <TextInput style = {styles.input}
                placeholder = 'Title' onChangeText = {(text) => {this.setState({title:text})}}>
                </TextInput>

                
                
               <Button title = "Submit" onPress = {() => {this.submit()}}/>

                
                
               
                
                
            </View>
             

            
        );
    }
}

const styles = StyleSheet.create({
regform : {
        textAlign:'center',
        backgroundColor:'lightblue',
        flex:1,
        alignSelf:'stretch',
        marginTop:StatusBar.currentHeight,
    
        
        
    },
header: {
    fontSize:24,
    color:'black',
    fontWeight:'bold',
    marginBottom:'40px',
    marginTop:'30px',
    textAlign:'center'

    

},
input:{
    
    width:'90%',
    backgroundColor:'white',
    padding:10,
    marginTop:10,
    marginBottom:10,
    marginLeft:'20px',
    borderRadius:'10px',

    
},
date:{
    flexDirection:'row',
    marginTop:10,
    marginBottom:10,
    
},
dob:{
    marginLeft:'7%'
    
},




}

);
export default App;
